import { Route, Switch } from 'react-router-dom'
import './customer.css'

export default function Customer() {

    const getContent = () => {
        return (
            <Switch>
                <Route path='/customer/home'>

                </Route>
                <Route path='/customer/temp'>
                    {console.log(123)}
                </Route>
            </Switch>
        )
    }


    return (<div className='Customer'>
        {getContent()}
    </div>)
}
